export function CloseIcon({ fill, classes = "" }) {
  return (
    <svg
      xmlns="http://www.w3.org/2000/svg"
      fill={"black" || "none"}
      className={classes}
      viewBox="0 0 24 24"
    >
      <path
        stroke="currentColor"
        strokeLinecap="round"
        strokeLinejoin="round"
        strokeWidth="2"
        d="M17 7L7 17M7 7l10 10"
      ></path>
    </svg>
  );
}
